import React, { useState, useEffect } from 'react';
import './App.css';
import SheetEvents from './components/SheetEvents';
import GoogleCalendar from './components/GoogleCalendar';
import { gapi } from 'gapi-script';

function App() {
  const [currentView, setCurrentView] = useState('home');
  const [signedIn, setSignedIn] = useState(false);
  const [gapiInitialized, setGapiInitialized] = useState(false);
  
  const CLIENT_ID = '1025583778510-nhiumsp7ohboveaj8lcbqmstfopup17q.apps.googleusercontent.com';
  const API_KEY = 'AIzaSyAWhQF4XMLansrLQRNk3Cx0kwQALO2Rnf8';
  const SCOPES = 'https://www.googleapis.com/auth/calendar.events https://www.googleapis.com/auth/spreadsheets';
  const DISCOVERY_DOC = 'https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest';

  useEffect(() => {
    function start() {
      gapi.client.init({
        apiKey: API_KEY,
        clientId: CLIENT_ID,
        scope: SCOPES,
        discoveryDocs: [DISCOVERY_DOC],
      }).then(() => {
        setGapiInitialized(true);
        gapi.auth2.getAuthInstance().isSignedIn.listen(setSignedIn);
        setSignedIn(gapi.auth2.getAuthInstance().isSignedIn.get());
      }).catch(error => {
        console.error('Error initializing GAPI client', error);
      });
    }

    gapi.load('client:auth2', start);
  }, []);

  const signIn = () => gapi.auth2.getAuthInstance().signIn();
  const signOut = () => {
    gapi.auth2.getAuthInstance().signOut();
    navigateTo('home');
  };

  const navigateTo = (view) => {
    // Removed the sign-in check that was here
    setCurrentView(view);
  };

  const renderHome = () => (
    <div className="home-container">
      <div className="app-description">
        <p>Welcome to the Event Management App! This application helps you manage events using Google Sheets and Google Calendar. Create, view, and organize your events all in one place.</p>
      </div>
      
      {!signedIn ? (
        <div className="sign-in-container">
          <p>Sign in to access Google Sheets and Calendar features</p>
          <button className="google-sign-in-btn" onClick={signIn}>
            <span className="google-icon">G</span>
            Sign in with Google
          </button>
        </div>
      ) : (
        <div className="cards-container">
          <div className="feature-card sheets-card" onClick={() => navigateTo('sheets')}>
            <div className="card-icon">ðŸ“‹</div>
            <h3>Google Sheets Events</h3>
            <p>View and manage events stored in Google Sheets</p>
            <button className="card-btn">Manage Sheet Events</button>
          </div>
          
          <div className="feature-card calendar-card" onClick={() => navigateTo('calendar')}>
            <div className="card-icon">ðŸ“…</div>
            <h3>Google Calendar Events</h3>
            <p>Create and view events in your Google Calendar</p>
            <button className="card-btn">Manage Calendar Events</button>
          </div>
        </div>
      )}
    </div>
  );

  return (
    <div className="App">
      <header className="app-header">
        <span className="app-icon">ðŸ“†</span>
        <h1 className="app-title">Event Management App for Google Sheets And Google Calendar</h1>
        {signedIn && (
          <button className="sign-out-btn" onClick={signOut}>
            <span className="btn-icon">ðŸšª</span> Sign Out
          </button>
        )}
      </header>
      
      {currentView === 'home' && renderHome()}
      {currentView === 'sheets' && <SheetEvents onBack={() => navigateTo('home')} />}
      {currentView === 'calendar' && <GoogleCalendar onBack={() => navigateTo('home')} />}
    </div>
  );
}

export default App;
